int Sound::findSound(char code) {
    for (int i = 0; i < 40; i++) {
        if (SoundMeta[i].code == code) {
            return i;
        }
    }
    // Not found is '_' (silence)
    return 39;
}

void Sound::getGSMFrame(int f, uint8_t* gsmData) {
    for (unsigned int i = 0; i < 33; i++) {
        gsmData[i] = SoundData[((start + f) * 33) + i];
    }
}

